      <IndividualCard>       
        <h2>{id}</h2>
        <p>{name}</p>
        <p>{brand}</p>
        <p>{price}</p>
        <p>{rating}</p>
        <LogoImage></LogoImage>
      </IndividualCard>
    );
  }
